import zezwolenie_opcje from "../../../static/pagedata/zezwolenie";
import { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import MenuBlock from "./MenuBlock";

const Zezwolenie = () => {
  const [options, setOptions] = useState([]);

  useEffect(() => {
    getOptions();
  });

  const getOptions = () => {
    setOptions(zezwolenie_opcje);
  };
  return (
    <Container className="grey-box origins">
      <Container className="row-wrapper">
        <Row className="permanent-residence-permit">
          {options.map((option) => (
            <Col>
              <MenuBlock index={option} title={option} />
            </Col>
          ))}
        </Row>
      </Container>
    </Container>
  );
};

export default Zezwolenie;
